(function() {
    'use strict';

    // Objeto que mapeia classes ou IDs de elementos para estilos de substituição
    const estilosParaSubstituir = {

        // INTERFACE
        '_64p9P': 'background-color: #050b11;', //campo inicial

        'iffbo4e8': 'background-color: #070f1a;border-bottom: solid 1px #092a46;', //cabeçalho arquivadas 1
        's9raicp8': 'background-color: #0a0e17;border-bottom: solid 1px #092a46;', //cabeçalho arquivadas 2

        '_1s7Pa': 'background-color: #0d0a17;', //div pesquisa
        '_2vDPL': 'background-color: #090611;border: solid 1px rgba(128, 92, 227, 0.77);', //campo de pesquisa
        '_199zF': 'background-color: #0b101b', // contatos side bar
        '_8nE1Y': 'border-top: 1px solid rgba(32, 114, 219, 0.7)', // borda contatos side bar
        '_1AHcd': 'border-top: 1px solid rgba(2, 49, 138, 0.44);',  // borda foto contatos side bar

        'y_sn4': 'color: #dae3e8; text-shadown: 2px 1px 3px #fff',
        'g0rxnol2': 'color: #dae3e8; text-shadown: 2px 1px 3px #fff',

        '_2xAQV': 'border-left: solid 1px rgba(128, 92, 227, 0.65);',
        'o2zu3hjb': 'border: solid 1px rgba(128, 92, 227, 0.85);',

        'side': 'background-color: #000;',

        'lyvj5e2u': 'background-color: #210240; border-bottom: solid 1px #6021bd;',
        '_1sPvB': 'color: #cddef9;',

        '_3fGK2': 'background-color: rgba(2, 12, 30, 0.29)',


        // CHAT
        'AmmtE': 'background-color: #16072d;border-bottom: solid 1px #8928fd96;', //chat top bar
        '_3W2ap': 'color: #e3f7ff;text-shadow: .5px 2px 2px #7d25ae;', //chat top name
        'message-in ._1BOF7': 'background-color: #0b0a0fad;border: solid 1px #004873;font-family: "Century Gothic", sans-serif;', //msg >>
        '_3pMOs': 'background-color: #0f0d15b2;font-family: "Arial Black", Gadget, sans-serif;', //resp msg >>
        'message-out ._1BOF7': 'background-color: #0000009c;border: solid 1px #0c6a4b;', //msg <<

        '_2lSWV': 'background-color: #03070f;border-top: solid .5px #141453;', // send div
        '_3Uu1_': 'background-color: #0e1924;border: 1px solid #133e42;', // canpo send
        //'xxx': 'xxx',
        //'xxx': 'xxx',
        // Adicione mais pares de classes ou IDs aqui
    };

      // Função para substituir estilos CSS em elementos
      function substituirEstilos() {
          for (const seletor in estilosParaSubstituir) {
              const elementos = document.querySelectorAll(`.${seletor}, #${seletor}`);
              elementos.forEach(elemento => {
                  elemento.style.cssText += estilosParaSubstituir[seletor];
              });
          }
      }

      setTimeout(function(){
        setInterval(substituirEstilos, 550);
        //substituirEstilos();
      }, 5000);

})();


